package controledenotas.persistence.entity;

import java.util.*;
import javax.inject.Inject;
import javax.persistence.*;

import br.gov.frameworkdemoiselle.stereotype.PersistenceController;

import controledenotas.domain.entity.Professor;
import br.gov.frameworkdemoiselle.template.JPACrud;
import javax.persistence.criteria.*;

@PersistenceController
public class ProfessorDAO extends JPACrud {

	private static final long serialVersionUID = 1L;

	@Override
	public List findByExample(Professor example) {
		if (example == null) {
			example = new Professor();
		}
		return super.findByExample(example);
	}

	public List findByCriteria(java.util.Map parameters) {
		if (parameters == null) {
			parameters = new java.util.HashMap();
		}
		CriteriaBuilder cb = super.getCriteriaBuilder();
		CriteriaQuery q = cb.createQuery(Professor.class);
		Root r = q.from(Professor.class);
		Predicate where = null;
		Object parameter = null; 
		parameter = parameters.get("matricula");
		if (parameter != null) {
			Predicate expression = null;
			if (parameter instanceof java.util.List) {
				@SuppressWarnings("unchecked")
				List collection = (List)parameter;
				expression = r.get("nome").in(collection);
			} else if (parameter instanceof String && ((String)parameter).length()>0) {
				expression = cb.like(r.get("nome"), "%" + parameter + "%");
			}
			if (expression != null) {
				if (where == null) {
					where = expression;
				} else {
					where = cb.and(where, expression);
				}
			}
		}
		parameter = parameters.get("senha");
		if (parameter != null) {
			Predicate expression = null;
			if (parameter instanceof java.util.List) {
				@SuppressWarnings("unchecked")
				List collection = (List)parameter;
				expression = r.get("disciplina").in(collection);
			} else if (parameter instanceof String && ((String)parameter).length()>0) {
				expression = cb.like(r.get("disciplina"), "%" + parameter + "%");
			}
			if (expression != null) {
				if (where == null) {
					where = expression;
				} else {
					where = cb.and(where, expression);
				}
			}
		}
		if (where != null) {
			q.where(where);
		}
		List results =  getEntityManager().createQuery(q).getResultList();
		return results;
	}

}

